--
-- Create procedure `Proc_GetFixedAssets`
--
CREATE DEFINER = 'dev'@'%'
PROCEDURE Proc_GetFixedAssets ()
BEGIN
  SELECT
    fa.*,
    d.DepartmentCode,
    d.DepartmentName,
    fac.FixedAssetCategoryCode,
    fac.FixedAssetCategoryName
  FROM FixedAsset fa,
       Department d,
       FixedAssetCategory fac
  WHERE d.DepartmentId = fa.DepartmentId
  AND fac.FixedAssetCategoryId = fa.FixedAssetCategoryId
  ORDER BY fa.CreatedDate DESC;
END
$$

