--
-- Create procedure `Proc_GetFixedAssetFilter`
--
CREATE DEFINER = 'dev'@'%'
PROCEDURE Proc_GetFixedAssetFilter (IN FixedAssetCode varchar(100), IN FixedAssetName varchar(255), IN DepartmentId char(36), IN FixedAssetCategoryId char(36), IN PageIndex int, IN PageSize int, IN IsCount bit)
BEGIN
  IF IsCount IS NOT NULL THEN
    SELECT
      COUNT(*)
    FROM FixedAsset fa
    WHERE (fa.FixedAssetCode IS NOT NULL
    AND fa.FixedAssetCode LIKE CONCAT('%', FixedAssetCode, '%'))
    OR (fa.FixedAssetName IS NOT NULL
    AND fa.FixedAssetName LIKE CONCAT('%', FixedAssetName, '%'))
    OR (fa.DepartmentId IS NOT NULL
    AND fa.DepartmentId LIKE CONCAT('%', DepartmentId, '%'))
    OR (fa.FixedAssetCategoryId IS NOT NULL
    AND fa.FixedAssetCategoryId LIKE CONCAT('%', FixedAssetCategoryId, '%'));
  ELSE
    SET PageIndex = (PageIndex - 1) * PageSize;
    SELECT
      *
    FROM FixedAsset fa
    WHERE (fa.FixedAssetCode IS NOT NULL
    AND fa.FixedAssetCode LIKE CONCAT('%', FixedAssetCode, '%'))
    OR (fa.FixedAssetName IS NOT NULL
    AND fa.FixedAssetName LIKE CONCAT('%', FixedAssetName, '%'))
    OR (fa.DepartmentId IS NOT NULL
    AND fa.DepartmentId LIKE CONCAT('%', DepartmentId, '%'))
    OR (fa.FixedAssetCategoryId IS NOT NULL
    AND fa.FixedAssetCategoryId LIKE CONCAT('%', FixedAssetCategoryId, '%'))
    ORDER BY fa.CreatedDate DESC LIMIT PageIndex, PageSize;
  END IF;
END
$$

--
-- Create procedure `Proc_GetFixedAssetByFixedAssetCode`
--
CREATE DEFINER = 'dev'@'%'
PROCEDURE Proc_GetFixedAssetByFixedAssetCode (IN FixedAssetId char(36), IN FixedAssetCode varchar(255))
BEGIN
  IF FixedAssetId IS NULL THEN
    SELECT
      *
    FROM FixedAsset fa
    WHERE fa.FixedAssetCode = FixedAssetCode;
  ELSE
    SELECT
      *
    FROM FixedAsset fa
    WHERE fa.FixedAssetCode = FixedAssetCode
    AND fa.FixedAssetId <> FixedAssetId;
  END IF;
END
$$

